  const requestData = {
    headers: {
      Authorization: token,
    },
    queryStringParameters: {
      requested_filename: "test",
      upload_date: "test",
    },
  };
  const data = await API.get("phibyeapi", "/pulldata", requestData);

  console.log("data: ", data);
  */
}

export default callApiDynamo;
